import './Header.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFaceMehBlank, faPlusCircle } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from 'react-router-dom';

function Header() {
  const navigate = useNavigate();
  const handleAddProject = () => {
    navigate(`/addproject`);
  };
  const handleCallLoginPage = () => {
    navigate(`/addproject`);
  };
  return (
    <>
      <div className='spacer'></div>
      <header className='header'>
        <div className='header-logo'>
          <h2>Project Vault</h2>
        </div>
        <div className='header-nav-elements'>
          <a href="#">
            <div>Home</div>
          </a>
          <a href="#">
            <div>About</div>
          </a>
          <a href="#">
            <div>Contact</div>
          </a>
          <a href="#">
            <div>Upload</div>
          </a>
          <a href="#">
            <div>Login</div>
          </a>
          <a onClick={handleAddProject}>
            <div>
              <FontAwesomeIcon icon={faPlusCircle} className='icon' />
            </div>
          </a>
          <a onClick={handleCallLoginPage}>
            <div>
              <FontAwesomeIcon icon={faFaceMehBlank} className='icon' />
            </div>
          </a>
        </div>
      </header>
    </>
    
  );
}

export default Header;
